import React from "react";
import { ReactNavbar } from "react-responsive-animate-navbar";
import imageLogo from '../custome logo/Background (2).png'
import Home  from "../pages/Home";
import Login from "../pages/Login";
import SignUp from "../pages/SignUp";
import Items from "../pages/Items";
import AboutAndContact from "../pages/AboutAndContact";


function Navbar(){
  return (
    <div
      style={{ Height: "100vh", width: "100%", position: "fixed"}}
    >

      <ReactNavbar
        color="black"
        logo = {imageLogo}
        menu={[
          { name: "HOME", to: "/", component: Home },
          { name: "LOGIN", to: "/login",component:Login },
          { name: "SIGNUP", to: "/signup",component:SignUp },
          { name: "MARKET ITEMS", to: "/about", component: Items },
          { name: " CONTACT", to: "/contact" , component: AboutAndContact },


        ]}
        social={[
          {
            name: "Linkedin",
            url: "https://www.linkedin.com/kidussintayehu",
            icon: ["fab", "linkedin-in"],
          },
          {
            name: "Facebook",
            url: "https://www.facebook.com/siant.sintayehu/",
            icon: ["fab", "facebook-f"],
          },
          {
            name: "Instagram",
            url: "https://www.instagram.com/siantsintayehu/",
            icon: ["fab", "instagram"],
          },
          {
            name: "Github",
            url: "https://github.com/kidussintayehu",
            icon: ["fab", "github"],
          },
        ]}
        sticky
      />
    </div>
  );
};

export default Navbar;
